import React from'react';

import { BrowserRouter as Router, Route, Routes} from 'react-router-dom';
import { Login } from '../Login';

function App() {

  return (
      <Router>
        <Routes>
          < Route element = { <Login /> }  path = "/login" exact /> 

        </Routes>
      </Router>
  );

}

export default App;
